    internal InnerDistributionQueryStringObjectFactory ForwardedQueryStringsFactory { get; set; }

    protected override Humidifier.Lightsail.DistributionTypes.CacheSettings Create()
    {
        var cacheSettingsResult = CreateCacheSettings();
        factoryAction?.Invoke(cacheSettingsResult);

        return cacheSettingsResult;
    }

    private Humidifier.Lightsail.DistributionTypes.CacheSettings CreateCacheSettings()
    {
        var cacheSettingsResult = new Humidifier.Lightsail.DistributionTypes.CacheSettings();

        return cacheSettingsResult;
    }
    public override void CreateChildren(Humidifier.Lightsail.DistributionTypes.CacheSettings result)
    {
        base.CreateChildren(result);

        result.ForwardedCookies ??= ForwardedCookiesFactory?.Build();
        result.ForwardedHeaders ??= ForwardedHeadersFactory?.Build();
        result.ForwardedQueryStrings ??= ForwardedQueryStringsFactory?.Build();
    }

} // End Of Class

